def my_func(expression: str) -> bool:
    # Split the expression by OR operator '|'
    or_parts = expression.split('|')

    # Evaluate each part joined by OR
    for or_part in or_parts:
        # Split the OR part by AND operator '&'
        and_parts = or_part.split('&')

        # Evaluate the AND parts
        and_result = True
        for and_part in and_parts:
            if and_part == 't':
                and_result = and_result and True
            elif and_part == 'f':
                and_result = and_result and False

        # If any AND result is True, the OR result is True
        if and_result:
            return True

    # If none of the OR parts are True, return False
    return False
